import { jsPDF } from "jspdf";
jsPDF.API.events.push([
  "addFonts",
  function () {
    this.addFileToVFS("Amiri-Italic_italic.ttf", "<base64-encoded-font-data>");
    this.addFont("Amiri-Italic_italic.ttf", "Amiri", "normal");
  },
]);
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("Amiri-Italic-italic.ttf", font);
  this.addFont("Amiri-Italic-italic.ttf", "Amiri-Italic", "italic");
};
jsPDF.API.events.push(["addFonts", callAddFont]);
